import React from "react";
import styled from "styled-components";

import ImageSetting from "./ImageSetting";

const EditModal = () => {
  return (
    <React.Fragment>
      <Wrap>
        <ImageSetting />
      </Wrap>
    </React.Fragment>
  );
};

export default EditModal;

const Wrap = styled.div`
  display: flex;
  flex-direction: column;
`;
